import React, {useEffect, useState} from 'react';
import {BrowserRouter as Router, Route, Switch} from 'react-router-dom';
import Navbar from './components/Navbar/Navbar';
import NavbarConnected from './components/SideBar/NavbarConnected'
import Accueil from './screens/Accueil/Accueil';
import Contact from './screens/Contact';
import SignInSignUp from './screens/SignInSignUp/SignInSignUp';
import ForgotPassword from './screens/SignInSignUp/ForgotPassword/ForgotPassword';
import Dashboard from './screens/Dashboard/Dashboard'
import GlobalStyle from './GlobalStyles';

//redux
import {useSelector} from 'react-redux'


function App() {

  const isLogged = useSelector(state => state.isLogged)

  return (
    <React.Fragment>
      <Router>
          <GlobalStyle/>
          <Switch>
            <Route exact path ='/'  component={Accueil}/>
            <Route       path ='/contact'  component={Contact}/>
            <Route       path ='/signIn'  component={SignInSignUp}/>
            <Route       path ='/forgot-password'  component={ForgotPassword}/>
            <Route       path ='/dashboard'  component={Dashboard}/>
          </Switch>
      </Router>   
    </React.Fragment>
  );
}

export default App;


/**          {!isLogged ? <Navbar/> : null}
 */
